import React, { useEffect } from 'react';
import { BrowserRouter, Redirect, Route, Switch } from 'react-router-dom';
import Header from './components/header';
import Login from './components/login';
import NotFound from './components/notfound';
import Dashboard from './components/dashboard';
import CreateRequest from './components/createRequest';
import EditRequest from './components/editRequest';
import { useDispatch, useSelector } from 'react-redux';
import { getEmployee } from './redux/actions';
import employeeService from './services/employee.service';
import { EmployeeState } from './redux/reducer';

function App() {
  // get state
  const employee = useSelector((state: EmployeeState) => state.employee);
  const dispatch = useDispatch();

  // checks back end if there is a user logged in
  useEffect(() => {
      employeeService.getLogin().then((status) => {
        if (status && status === 204) {
          console.log('Current employee', employee)
          // dispatch(getEmployee(employee));
        }
          console.log(status);
      }).catch(() => {
        console.log('User not found!');
      });
  }, [dispatch]);

  return (
    <React.Fragment>
      <BrowserRouter>
      <Header />
        <Switch>
          <Route exact path="/" render= { () => <Redirect to="/login" />} />
          <Route path="/login" component={Login} />
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/createrequest" component={CreateRequest} />
          <Route path="/editrequest" component={EditRequest} />
          <Route component={NotFound} />
        </Switch>
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
